import {useMemo, useRef, useState} from "react";

export const tvVideoMapping = useMemo(()=>{[{
  tvName: "hippo",
  directory: "/hippo"
},{
  tvName: "falcon",
  directory: "/falcon"
},{
  tvName: "all",
  directory: "/all"
}
]},[])
